pragma solidity ^0.8.6;
// SPDX-License-Identifier: UNLICENSED

interface ERC20 {
    function transfer(address to, uint256 value) external returns (bool);
    event Transfer(address indexed from, address indexed to, uint256 value);
}

contract Faucet {
    uint256 constant public tokenAmount = 100000000000000000000; // 100 coin
    uint256 constant public waitTime = 1 days;

    ERC20 public tokenInstance;

    mapping(address => uint256) lastAccessTime;

    // address from which Faucet drains the token
    constructor(address _tokenInstance) {
        require(_tokenInstance != address(0));
        tokenInstance = ERC20(_tokenInstance);
    }

    function requestTokens() public {
        require(allowedToWithdraw(msg.sender));
        tokenInstance.transfer(msg.sender, tokenAmount);
        // Cool down
        lastAccessTime[msg.sender] = block.timestamp + waitTime;
    }

    function allowedToWithdraw(address _address) public view returns (bool) {
        if (lastAccessTime[_address] == 0) return true;
        else if (block.timestamp >= lastAccessTime[_address]) return true;
        return false;
    }
}
